<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h1 id="Correlation-&amp;-Dependancy">Correlation &amp; Dependancy<a class="anchor-link" href="#Correlation-&amp;-Dependancy">&#182;</a></h1>
</div>
</div>
</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>Finding links between the different variables is a very important task. The main purpose of Data Science is to find which variables will have an impact on the Business. Having these information will help us to understand the data and to take decisions.</p>
<p>Besides, many Machine Learning Models are sensible to the number of variables and the link between the different variables. Finding variables correlations and dependancies is also a very important task to know which variables to use when dealing with Machine Learning algorithms.</p>
<p>Let's use the Telco Churn dataset to understand how to find links between the different variables in Vertica ML Python.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[52]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="kn">from</span> <span class="nn">vertica_ml_python</span> <span class="k">import</span> <span class="o">*</span>
<span class="n">vdf</span> <span class="o">=</span> <span class="n">vDataFrame</span><span class="p">(</span><span class="s2">&quot;public.churn&quot;</span><span class="p">)</span>
<span class="nb">print</span><span class="p">(</span><span class="n">vdf</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>



