 white;">9</td><td style="border: 1px solid white;">0</td><td style="border: 1px solid white;">False</td><td style="border: 1px solid white;">Yes</td></tr><tr ><td style="font-size:1.02em;background-color:#263133;color:white"><b>2</b></td><td style="border: 1px solid white;">Yes</td><td style="border: 1px solid white;">No</td><td style="border: 1px solid white;">Fiber optic</td><td style="border: 1px solid white;">False</td><td style="border: 1px solid white;">73.9</td><td style="border: 1px solid white;">True</td><td style="border: 1px solid white;">No</td><td style="border: 1px solid white;">True</td><td style="border: 1px solid white;">No</td><td style="border: 1px solid white;">0004-TLHLJ</td><td style="border: 1px solid white;">Electronic check</td><td style="border: 1px solid white;">No</td><td style="border: 1px solid white;">Male</td><td style="border: 1px solid white;">True</td><td style="border: 1px solid white;">No</td><td style="border: 1px solid white;">280.85</td><td style="border: 1px solid white;">Month-to-month</td><td style="border: 1px solid white;">4</td><td style="border: 1px solid white;">0</td><td style="border: 1px solid white;">False</td><td style="border: 1px solid white;">No</td></tr><tr ><td style="font-size:1.02em;background-color:#263133;color:white"><b>3</b></td><td style="border: 1px solid white;">Yes</td><td style="border: 1px solid white;">Yes</td><td style="border: 1px solid white;">Fiber optic</td><td style="border: 1px solid white;">False</td><td style="border: 1px solid white;">98.0</td><td style="border: 1px solid white;">True</td><td style="border: 1px solid white;">No</td><td style="border: 1px solid white;">True</td><td style="border: 1px solid white;">No</td><td style="border: 1px solid white;">0011-IGKFF</td><td style="border: 1px solid white;">Electronic check</td><td style="border: 1px solid white;">Yes</td><td style="border: 1px solid white;">Male</td><td style="border: 1px solid white;">True</td><td style="border: 1px solid white;">Yes</td><td style="border: 1px solid white;">1237.85</td><td style="border: 1px solid white;">Month-to-month</td><td style="border: 1px solid white;">13</td><td style="border: 1px solid white;">1</td><td style="border: 1px solid white;">True</td><td style="border: 1px solid white;">No</td></tr><tr ><td style="font-size:1.02em;background-color:#263133;color:white"><b>4</b></td><td style="border: 1px solid white;">No</td><td style="border: 1px solid white;">No</td><td style="border: 1px solid white;">Fiber optic</td><td style="border: 1px solid white;">False</td><td style="border: 1px solid white;">83.9</td><td style="border: 1px solid white;">True</td><td style="border: 1px solid white;">Yes</td><td style="border: 1px solid white;">True</td><td style="border: 1px solid white;">No</td><td style="border: 1px solid white;">0013-EXCHZ</td><td style="border: 1px solid white;">Mailed check</td><td style="border: 1px solid white;">No</td><td style="border: 1px solid white;">Female</td><td style="border: 1px solid white;">True</td><td style="border: 1px solid white;">Yes</td><td style="border: 1px solid white;">267.4</td><td style="border: 1px solid white;">Month-to-month</td><td style="border: 1px solid white;">3</td><td style="border: 1px solid white;">1</td><td style="border: 1px solid white;">True</td><td style="border: 1px solid white;">No</td></tr><tr><td style="border-top: 1px solid white;background-color:#263133;color:white"></td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td></tr></table>
</div>

</div>

<div class="output_area">

<div class="prompt"></div>


<div class="output_subarea output_stream output_stdout output_text">
<pre>&lt;object&gt;  Name: churn, Number of rows: 7043, Number of columns: 21
</pre>
</div>
</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>Pearson correlation help us to find linear links between the variables. Having a strong Pearson relationship means that the two input variables are linearly correlated. It is the most used correlation function.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[51]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">vdf</span><span class="o">.</span><span class="n">corr</span><span class="p">(</span><span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;pearson&quot;</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>We can notice that the tenure is well correlated to the Total Charges which makes sense.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[58]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">vdf</span><span class="o">.</span><span class="n">scatter</span><span class="p">([</span><span class="s2">&quot;tenure&quot;</span><span class="p">,</span> <span class="s2">&quot;TotalCharges&quot;</span><span class="p">])</span>
<span class="n">vdf</span><span class="o">.</span><span class="n">corr</span><span class="p">([</span><span class="s2">&quot;tenure&quot;</span><span class="p">,</span> <span class="s2">&quot;TotalCharges&quot;</span><span class="p">],</span> <span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;pearson&quot;</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
</div>

</div>

<div class="output_area">

<div class="prompt output_prompt">Out[58]:</div>




<div class="output_text output_subarea output_execute_result">
<pre>0.825880460933193</pre>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>However, having a low Pearson relationship doesn't mean not being correlated. For example, let's compute the Pearson correlation between the tenure and the Total Charges to the power of 20.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[59]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">vdf</span><span class="o">.</span><span class="n">eval</span><span class="p">(</span><span class="n">name</span> <span class="o">=</span> <span class="s2">&quot;TotalCharges^20&quot;</span><span class="p">,</span> <span class="n">expr</span> <span class="o">=</span> <span class="s2">&quot;POWER(TotalCharges, 20)&quot;</span><span class="p">)</span>
<span class="n">vdf</span><span class="o">.</span><span class="n">scatter</span><span class="p">([</span><span class="s2">&quot;tenure&quot;</span><span class="p">,</span> <span class="s2">&quot;TotalCharges^20&quot;</span><span class="p">])</span>
<span class="n">vdf</span><span class="o">.</span><span class="n">corr</span><span class="p">([</span><span class="s2">&quot;tenure&quot;</span><span class="p">,</span> <span class="s2">&quot;TotalCharges^20&quot;</span><span class="p">],</span> <span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;pearson&quot;</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
</div>

</div>

<div class="output_area">

<div class="prompt output_prompt">Out[59]:</div>




<div class="output_text output_subarea output_execute_result">
<pre>0.224994408804537</pre>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>We know that the tenure and the Total Charges are highly linearly correlated. However we can notice that the correlation between the tenure and the Total Charges to the power of 20 is not very high. Indeed, Pearson coefficient is not robust to monotonic relationship. Rank based correlations are. That's why sometimes using Spearman correlation is a more suitable choice.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[40]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">vdf</span><span class="o">.</span><span class="n">corr</span><span class="p">(</span><span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;spearman&quot;</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>Spearman coefficient determines the monotonic relationships between the variables.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[60]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">vdf</span><span class="o">.</span><span class="n">corr</span><span class="p">([</span><span class="s2">&quot;tenure&quot;</span><span class="p">,</span> <span class="s2">&quot;TotalCharges^20&quot;</span><span class="p">],</span> <span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;spearman&quot;</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt output_prompt">Out[60]:</div>




<div class="output_text output_subarea output_execute_result">
<pre>0.883103368818293</pre>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>We can notice that Spearman coefficient stays the same if one of the variable can be expressed using a monotonic function on the other. The same applies to Kendall coefficient.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[41]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">vdf</span><span class="o">.</span><span class="n">corr</span><span class="p">(</span><span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;kendall&quot;</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>We can notice that Kendall will also detect the monotonic relationship.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[69]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">vdf</span><span class="o">.</span><span class="n">corr</span><span class="p">([</span><span class="s2">&quot;tenure&quot;</span><span class="p">,</span> <span class="s2">&quot;TotalCharges^20&quot;</span><span class="p">],</span> <span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;kendall&quot;</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt output_prompt">Out[69]:</div>




<div class="output_text output_subarea output_execute_result">
<pre>0.742340877736057</pre>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>However Kendall is very expensive to compute. That's why most of the time, we will use Pearson and Spearman when dealing with numerical variables correlations.</p>
<p>Binary features are considered as numerical but it is not truly the case. Correlation between a binary variable and a numerical variable can lead to false assumptions as binary variables can only takes two values which is hard to interpret in terms of order. That's why in this case, it is preferable to use the 'Biserial Point' method. It is a powerful method to understand the link between a binary variable and a numerical variable.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[45]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">vdf</span><span class="o">.</span><span class="n">corr</span><span class="p">(</span><span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;biserial&quot;</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>The last important relationship is the one between categorical columns. In this case, the 'Cramer's V' method is very efficient. As there is no position in the Euclidian space for those variables, the 'Cramer's V' coefficients can not be negative (sign of an opposite relationship) and they will range in the interval [0;1].</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[42]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">vdf</span><span class="o">.</span><span class="n">corr</span><span class="p">(</span><span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;cramer&quot;</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>Sometimes, we just need to look at the correlation between a response and other variables. The parameter 'focus' will show us only the needed correlation vector.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[70]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">vdf</span><span class="o">.</span><span class="n">corr</span><span class="p">(</span><span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;cramer&quot;</span><span class="p">,</span> <span class="n">focus</span> <span class="o">=</span> <span class="s2">&quot;Churn&quot;</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>We can see that the Churn is correlated to the type of contract (Month-to-Month, Year-to-Year...) which makes sense as the different types of contracts can give more or less flexibility to the user to churn. The internet service seems also to be correlated to the churn. Let's split the different categories to binaries to understand which services can influence the global churning.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[74]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">vdf</span><span class="p">[</span><span class="s2">&quot;InternetService&quot;</span><span class="p">]</span><span class="o">.</span><span class="n">get_dummies</span><span class="p">()</span>
<span class="n">vdf</span><span class="o">.</span><span class="n">corr</span><span class="p">(</span><span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;spearman&quot;</span><span class="p">,</span> 
         <span class="n">focus</span> <span class="o">=</span> <span class="s2">&quot;Churn&quot;</span><span class="p">,</span> 
         <span class="n">columns</span> <span class="o">=</span> <span class="p">[</span><span class="s2">&quot;InternetService_DSL&quot;</span><span class="p">,</span> 
                    <span class="s2">&quot;InternetService_Fiber_optic&quot;</span><span class="p">])</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>We can notice that the Fiber Optic option seems to be directly linked to the customers churn. Let's compute some aggregations to understand where is the causality.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[77]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">vdf</span><span class="p">[</span><span class="s2">&quot;contract&quot;</span><span class="p">]</span><span class="o">.</span><span class="n">get_dummies</span><span class="p">()</span>
<span class="n">vdf</span><span class="o">.</span><span class="n">groupby</span><span class="p">([</span><span class="s2">&quot;InternetService_Fiber_optic&quot;</span><span class="p">],</span> 
            <span class="p">[</span><span class="s2">&quot;AVG(tenure) AS tenure&quot;</span><span class="p">,</span> 
             <span class="s2">&quot;AVG(totalcharges) AS totalcharges&quot;</span><span class="p">,</span>
             <span class="s1">&#39;AVG(&quot;contract_month-to-month&quot;) AS &quot;contract_month-to-month&quot;&#39;</span><span class="p">,</span>
             <span class="s1">&#39;AVG(&quot;monthlycharges&quot;) AS &quot;monthlycharges&quot;&#39;</span><span class="p">])</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>



<div class="output_html rendered_html output_subarea ">
<table style="border-collapse: collapse; border: 2px solid white"><tr ><td style="font-size:1.02em;background-color:#263133;color:white"><b></b></td><td style="font-size:1.02em;background-color:#263133;color:white"><b>InternetService_Fiber_optic</b></td><td style="font-size:1.02em;background-color:#263133;color:white"><b>tenure</b></td><td style="font-size:1.02em;background-color:#263133;color:white"><b>totalcharges</b></td><td style="font-size:1.02em;background-color:#263133;color:white"><b>contract_month-to-month</b></td><td style="font-size:1.02em;background-color:#263133;color:white"><b>monthlycharges</b></td></tr><tr ><td style="font-size:1.02em;background-color:#263133;color:white"><b>0</b></td><td style="border: 1px solid white;">0</td><td style="border: 1px solid white;">31.9422346085635</td><td style="border: 1px solid white;">1558.06548526423</td><td style="border: 1px solid white;">0.442614644033443</td><td style="border: 1px solid white;">43.7882442361287</td></tr><tr ><td style="font-size:1.02em;background-color:#263133;color:white"><b>1</b></td><td style="border: 1px solid white;">1</td><td style="border: 1px solid white;">32.9179586563307</td><td style="border: 1px solid white;">3205.30457041344</td><td style="border: 1px solid white;">0.68733850129199</td><td style="border: 1px solid white;">91.5001291989664</td></tr></table>
</div>

</div>

<div class="output_area">

<div class="prompt output_prompt">Out[77]:</div>




<div class="output_text output_subarea output_execute_result">
<pre>&lt;object&gt;  Name: groupby, Number of rows: 2, Number of columns: 5</pre>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>It seems that users having the Fiber Optic Options tend more to churn not because of the option itself but probably because of the type of contracts and the monthly charges the users are paying to get it. Be careful when dealing with correlation as finding correlation doesn't mean finding causations !</p>
<p>Another important type of correlation is the auto-correlation. Let's use the Amazon dataset to understand it.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[78]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">vdf</span> <span class="o">=</span> <span class="n">vDataFrame</span><span class="p">(</span><span class="s2">&quot;public.amazon&quot;</span><span class="p">)</span>
<span class="nb">print</span><span class="p">(</span><span class="n">vdf</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>



<div class="output_html rendered_html output_subarea ">
<table style="border-collapse: collapse; border: 2px solid white"><tr ><td style="font-size:1.02em;background-color:#263133;color:white"><b></b></td><td style="font-size:1.02em;background-color:#263133;color:white"><b>date</b></td><td style="font-size:1.02em;background-color:#263133;color:white"><b>number</b></td><td style="font-size:1.02em;background-color:#263133;color:white"><b>state</b></td></tr><tr ><td style="font-size:1.02em;background-color:#263133;color:white"><b>0</b></td><td style="border: 1px solid white;">1998-01-01</td><td style="border: 1px solid white;">0</td><td style="border: 1px solid white;">Acre</td></tr><tr ><td style="font-size:1.02em;background-color:#263133;color:white"><b>1</b></td><td style="border: 1px solid white;">1998-01-01</td><td style="border: 1px solid white;">0</td><td style="border: 1px solid white;">Alagoas</td></tr><tr ><td style="font-size:1.02em;background-color:#263133;color:white"><b>2</b></td><td style="border: 1px solid white;">1998-01-01</td><td style="border: 1px solid white;">0</td><td style="border: 1px solid white;">Amapa</td></tr><tr ><td style="font-size:1.02em;background-color:#263133;color:white"><b>3</b></td><td style="border: 1px solid white;">1998-01-01</td><td style="border: 1px solid white;">0</td><td style="border: 1px solid white;">Amazonas</td></tr><tr ><td style="font-size:1.02em;background-color:#263133;color:white"><b>4</b></td><td style="border: 1px solid white;">1998-01-01</td><td style="border: 1px solid white;">0</td><td style="border: 1px solid white;">Bahia</td></tr><tr><td style="border-top: 1px solid white;background-color:#263133;color:white"></td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td><td style="border: 1px solid white;">...</td></tr></table>
</div>

</div>

<div class="output_area">

<div class="prompt"></div>


<div class="output_subarea output_stream output_stdout output_text">
<pre>&lt;object&gt;  Name: amazon, Number of rows: 6454, Number of columns: 3
</pre>
</div>
</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>The main purpose is to predict the number of forest fires in Brazil. To do it, we can draw an Autocorrelation Plot. Autocorrelation is the correlation between a variable and its past values (called lags).</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[81]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">vdf</span><span class="o">.</span><span class="n">autocorr</span><span class="p">(</span><span class="n">column</span> <span class="o">=</span> <span class="s2">&quot;number&quot;</span><span class="p">,</span>
             <span class="n">ts</span> <span class="o">=</span> <span class="s2">&quot;date&quot;</span><span class="p">,</span>
             <span class="n">by</span> <span class="o">=</span> <span class="p">[</span><span class="s2">&quot;state&quot;</span><span class="p">],</span>
             <span class="n">p</span> <span class="o">=</span> <span class="mi">48</span><span class="p">,</span>
             <span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;pearson&quot;</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>We can see the seasonality of the process. It is also possible to look at it using an Autocorrelation Matrix.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[83]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="n">vdf</span><span class="o">.</span><span class="n">autocorr</span><span class="p">(</span><span class="n">column</span> <span class="o">=</span> <span class="s2">&quot;number&quot;</span><span class="p">,</span>
             <span class="n">ts</span> <span class="o">=</span> <span class="s2">&quot;date&quot;</span><span class="p">,</span>
             <span class="n">by</span> <span class="o">=</span> <span class="p">[</span><span class="s2">&quot;state&quot;</span><span class="p">],</span>
             <span class="n">p</span> <span class="o">=</span> <span class="mi">36</span><span class="p">,</span>
             <span class="n">method</span> <span class="o">=</span> <span class="s2">&quot;pearson&quot;</span><span class="p">,</span>
             <span class="n">matrix</span> <span class="o">=</span> <span class="kc">True</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

<div class="output_wrapper">
<div class="output">


<div class="output_area">

<div class="prompt"></div>




<div class="output_png output_subarea ">
<img src="data:image/png;base64,
"
>
</div>

</div>

</div>
</div>

</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>It is mathematically impossible to build the perfect correlation function. However, we can find many different links between the variables.</p>
<p>Now we know how to explore our data. In the next chapter we will see how to enrich and build our final dataset using joins.</p>

</div>
</div>
</div>